// Solution to https://leetcode.com/problems/longest-substring-without-repeating-characters/submissions/
func TestLongestSubstringWoRepeatingChars(t *testing.T) {
    result := lengthOfLongestSubstring("abcabcbb")
    expectedResult := 3
    if result != expectedResult {
        t.Errorf("Got %d; expected %d", result, expectedResult)
    }
}

